"""
Complexity O(m*n)
This file will be ignored in calculation being inside "site-packages"
"""


def lcs(x, y):
    m = len(x)
    n = len(y)
    lcs = [[0] * (n + 1) for i in range(m + 1)]
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if x[i - 1] == y[j - 1]:
                lcs[i][j] = lcs[i - 1][j - 1] + 1
            else:
                lcs[i][j] = max(lcs[i - 1][j], lcs[i][j - 1])
    return lcs[m][n]
